# 공통 메서드 정의 (중복된 부분 재사용)
def time_wait(num, code):
    try:
        wait = WebDriverWait(driver, num).until(
            EC.presence_of_element_located((By.CSS_SELECTOR, code)))
        return wait  # 요소를 찾으면 반환
    except:
        print(code, '태그를 찾지 못하였습니다.')
        return None  # 요소를 찾지 못했을 경우 None 반환

def switch_frame(frame):
    driver.switch_to.default_content()  # frame 초기화
    driver.switch_to.frame(frame)  # frame 변경

# 전체 데이터를 저장할 dictionary 생성
all_data = {'제주도 맛집': []}

# 각 검색어에 대해 크롤링 수행
for key_word in keywords:
    try:
        print(f"[제주도 {key_word}] 검색 시작...")

        driver.switch_to.default_content()  # 프레임 기본 상태로 초기화
        # 검색어 입력 창이 나타날 때까지 기다리기
        if not time_wait(10, 'div.input_box > input.input_search'):
            print(f"[{key_word}] 검색어 입력 창을 찾을 수 없어 다음 검색어로 넘어갑니다.")
            continue  # 검색 창을 찾지 못하면 현재 검색어 건너뜀

        # 검색어 입력 및 검색
        search = driver.find_element(By.CSS_SELECTOR, 'div.input_box > input.input_search')
        search.click()
        search.clear()  # 검색창 초기화
        search.send_keys('제주도' + key_word)  # 검색어 입력
        search.send_keys(Keys.ENTER)  # 엔터버튼 누르기
        sleep(5)

        # 현재 URL 확인
        current_url = driver.current_url
        if "place/" in current_url:
            # 검색 결과가 하나로 바로 해당 장소 페이지로 리다이렉트된 경우
            try:
                # 프레임 전환 대기
                WebDriverWait(driver, 10).until(EC.frame_to_be_available_and_switch_to_it((By.ID, 'entryIframe')))

                # 리다이렉트된 장소 페이지에서 정보 추출  
                name = driver.find_element(By.CSS_SELECTOR, '.GHAhO').text  # 가게 이름
                type = driver.find_element(By.CSS_SELECTOR, '.lnJFt').text  # 가게 종류

                # 데이터 저장
                dict_temp = {
                    'raw_name': key_word,
                    'name': name,
                    'type': type
                }
                all_data['제주도 맛집'].append(dict_temp)
                print(f"[{key_word}] 가게 이름: {name}, 종류: {type}")

            except NoSuchElementException as e:
                print(f"[{key_word}] 정보 추출 실패: {e}")
            except TimeoutException as e:
                print(f"[{key_word}] 페이지 로딩 지연: {e}")
            driver.switch_to.default_content()  # 프레임 초기화
            sleep(3)
            continue  # 다음 검색어로 이동

        # frame 변경 후 페이지 내리기
        switch_frame('searchIframe')
        sleep(5)

        # 제주 맛집 리스트와 페이지 버튼 가져오기
        jeju_list = driver.find_elements(By.CSS_SELECTOR, 'li.VLTHu')

        # 첫 번째 결과만 가져오기
        if jeju_list:
            first_info = jeju_list[0]  # 첫 번째 가게 정보 선택
            name = first_info.find_element(By.CSS_SELECTOR, '.YwYLL').text  # 이름
            type = first_info.find_element(By.CSS_SELECTOR, '.YzBgS').text  # 종류

            # dict에 데이터 추가
            dict_temp = {
                'raw_name': key_word,
                'name': name,
                'type': type
            }
            all_data['제주도 맛집'].append(dict_temp)
            print(f"[{key_word}] 가게 이름: {name}, 종류: {type}")
        else:
            # dict에 데이터 추가
            dict_temp = {
                'raw_name': key_word,
                'name': '',
                'type': ''
            }
            # 검색 결과가 없을 경우 빈 리스트 추가
            all_data['제주도 맛집'].append(dict_temp)
            print(f"[{key_word}] 검색 결과가 없습니다.")

    except Exception as e:
        logging.error(f"[{key_word}] 오류 발생: {e}")
        continue  # 다음 키워드로 이동


# 데이터 저장 완료 후 종료
